Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('7','1.7','1.7 Lamparas de Alumbrado Pblico','Medida que promueve la implementacin de lmparas de alta eficiencia en el alumbrado pblico reduciendo las emisiones de GEI debido al menor uso de energa, en el marco del Plan de Acceso Universal a la Energa (RM N203-2013-MINEM/DM) y en donde se incluye el reemplazo de 100,000 lmparas de vapor de sodio de alta presin (VSAP) en alumbrado pblico por lmparas LED o de induccin, priorizando zonas vulnerables. Adems, contempla una segunda fase a travs de la implementacin de las fichas de homologacin de alumbrado pblico.','1','Reemplazo de lmparas de alumbrado pblico de vapor de sodio de alta presin por lmparas LED consiste en la implementacin de lmparas de alta eficiencia en el alumbrado pblico. Aplica para lmparas LED con fichas de homologacin, 100,000 de FISE. ','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('8','2.1','2.1 Medida de Coccin limpia (mbito rural)','Implementacin y sostenibilidad de tecnologas de coccin limpia (cocinas mejoradas y cocinas a gas licuado de petrleos) en zonas rurales, reemplazando aquellas cocinas o tecnologas convencionales (fogn abierto) poco eficientes en el mbito rural, con lo cual se reducir los consumos de combustibles empleados en cocinas tradicionales, tales como lea y carbn vegetal, reduciendo as emisiones de gases de efecto invernadero (GEI) y los efectos nocivos a la salud asociados a las emisiones gaseosas y del material particulado restante de la combustin.','2','Reduccin de las emisiones de gases de efecto invernadero (GEI) generadas por la coccin y calentamiento de alimentos a travs del uso de cocinas o tecnologas convencionales (fogn abierto) poco eficientes en el mbito rural. Incluye: cocinas mejoradas y a gas licuado de petrleo (GLP).','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('10','3.1','3.1 Combinacin de energas renovables','Aumentar la participacin de los Recursos Energticos de fuentes Renovables (RER) en la matriz energtica nacional en un 6.8% en el ao 2030, reduciendo la proporcin de la energa producida en base a la quema de combustibles fsiles, lo cual generar la reduccin de emisiones de gases de efecto invernadero (GEI). Asimismo, la medida incluye la implementacin de las centrales hidroelctricas con una capacidad instalada menor a 20 MW.','3','Aumentar la participacin de los Recursos Energticos Renovables (RER) y dar cumplimiento al Decreto Legislativo N 1002, Ley de Promocin de la Inversin en Generacin de Electricidad con el uso de Energas Renovables (2008).','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('9','2.2','2.2 Electrificacin Rural','En elaboracin','2','En elaboracin','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('11','3.2','3.2 Generacin Distribuida','Medida que abarca toda instalacin de generacin elctrica que inyecte energa elctrica a la red elctrica est conectada directamente a la Red de Distribucin.','3','Promover el uso e implementacin de sistemas de generacin elctrica con tecnologas limpias.','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('12','4.1','4.1 Promocin de vehculos elctricos a nivel nacional','Medida que propone reemplazar la matriz energtica utilizada en el transporte, la cual utiliza predominantemente combustibles fsiles (gasolina, disel, gas licuado de petrleo y gas natural vehicular), mediante una mayor participacin de vehculos elctricos en el parque vehicular, contribuyendo al cumplimiento del Plan Energtico Nacional 2014-2025 y reduciendo las emisiones de gases de efecto invernadero (GEI) gracias al reemplazo o al desplazamiento de vehculos que consumen gasolina o disel por nuevos vehculos elctricos. La meta trazada para esta medida de mitigacin en una primera etapa se da bajo 2 acciones: i) la introduccin de mnibus elctricos y ii) introduccin de vehculos livianos elctricos.','4','Reemplazar la matriz energtica utilizada de manera predominante en el transporte (gasolina, disel, GLP, GNV), a vehculos elctricos. ','Energa - Combustin mvil','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('1','1.1','1.1 Etiquetado de Eficiencia Energtico','Esta medida propone que los equipos que requieran suministros energticos incluyan en sus etiquetas, envases, empaques y publicidad, una etiqueta de eficiencia energtica a travs de la cual el consumidor pueda conocer el consumo de energa y la eficiencia energtica del producto para la toma de decisin de consumo, reduciendo as las emisiones de GEI debido a la reduccin del consumo de energa asociada a la mejora de eficiencia de los nuevos equipos a ser adquiridos por los consumidores. La medida se enmarca en el Reglamento Tcnico sobre el etiquetado de eficiencia energtica para equipos energticos, aprobado mediante Decreto Supremo N009-2017-EM.','1','Dar cumplimiento al Reglamento Tcnico sobre el etiquetado de eficiencia energtica para equipos energticos, aprobado mediante Decreto Supremo N009-2017-EM. Puede incluir aparatos de refrigeracin, calderas, motores elctricos, lavadoras, secadoras, equipos de aire acondicionado y calentadores de agua. No incluye luminarias. ','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('2','1.2','1.2 Eficiencia energtica en el sector industrial','Esta medida de mitigacin, propuesta por el Ministerio de Energa y Minas, propone la implementacin de medidas de eficiencia energtica en empresas del sector industrial fomentando la competitividad de la economa nacional y reduciendo el impacto ambiental negativo del uso y consumo de los energticos como la reduccin de emisiones de GEI. Esta medida se enmarca en la Ley de Promocin del Uso Eficiente de la Energa, Ley N27345, y su Reglamento aprobado por Decreto Supremo N053-2007-EM. As, se prev considerar el recambio de motores y calderas, una vez que se viabilice el Fondo de Financiamiento a la Eficiencia Energtica (FOFEE)','1','Fomentar la competitividad de la economa nacional y reducir el impacto ambiental negativo del uso y consumo de los energticos mediante la Ley de Promocin del Uso Eficiente de la Energa  Ley N27345 y su Reglamento, aprobado por Decreto Supremo N053-2007-EM.','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('3','1.3','1.3 Eficiencia energtica en el sector comercial','Medida que propone promover la racionalizacin del consumo de energa en el sector comercial de servicios.','1','Promover la racionalizacin del consumo de energa en el sector comercial de servicios, a travs de: a) reemplazo de lmparas de baja eficiencia por lmparas LED de 10W y b) instalacin de sensores de ocupacin hotelera, con el objetivo de controlar las unidades de aire acondicionado.','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('4','1.4','1.4 Auditoras energticas en el sector pblico','Medida que propone implementar acciones que contribuyan a reducir el consumo de energa sin que estas acciones afecten la calidad de los servicios prestados y recibidos en las entidades del sector pblico cuya facturacin mensual por consumo de energa elctrica sea mayor de cuatro (4) unidades impositivas tributarias (UIT), reduciendo as las emisiones de GEI debido a la reduccin del consumo energtico. Asimismo, prev que en un futuro las auditoras energticas puedan desarrollarse para el sector privado, bajo el mecanismo de un fondo de eficiencia energtica.','1','Implementar acciones que contribuyan a reducir el consumo de energa sin que estas acciones afecten la calidad de los servicios prestados y recibidos en las entidades del sector pblico. Incluye todo equipo que consuma electricidad (con y sin fichas de homologacin) con excepcin de lmparas con fichas.','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('5','1.5','1.5 Transformacin del mercado de iluminacin en el sector residencial','Medida que promueve la sustitucin de lmparas de baja eficiencia por tecnologas ms eficientes de iluminacin, reduciendo las emisiones de GEI debido al menor uso de energa, y generando la transformacin hacia un mercado de iluminacin ms eficiente, cuyo principal objetivo es promover el uso de lmparas que permitan un uso eficiente de la energa en el pas, sin menoscabar la calidad de la iluminacin, considerando los beneficios econmicos, ambientales y sociales que se tendran en el pas. La medida de mitigacin propone dos fases: i) el programa de distribucin de un milln y medio de lmparas energticamente ms eficientes a hogares de menores ingresos como meta al 2019, en el marco del Programa Anual de Promociones 2018, aprobado mediante Resolucin Ministerial N 021-2018-MINEM/DM, de acuerdo a lo establecido en el Plan de Acceso Universal a la Energa 2013-2022, aprobado con Resolucin Ministerial N 203-2013-MINEM-DM; y ii) la Estrategia de Iluminacin del Per, cuyo objetivo es incrementar la participacin de las lmparas eficientes en el mercado de iluminacin nacional, reduciendo el consumo de energa y por ende tambin reduciendo las emisiones de gases de efecto invernadero (como el CO2).','1','Promover el uso de lmparas que permitan un uso eficiente de la energa en el pas, sin menoscabar la calidad de la iluminacin, considerando los beneficios econmicos, ambientales y sociales que se tendran en el pas. Aplica para lmparas LED.','Energa - Combustin estacionaria','1');
Insert into T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO) values ('6','1.6','1.6 Reemplazo de lmparas de baja eficiencia por lmparas LED en el sector pblico','Reemplazo de lmparas de baja eficiencia por lmparas LED en el sector pblico reduciendo as el consumo de energa y por ende reduciendo tambin las emisiones de GEI, con el objetivo de impulsar el uso de lmparas y otros equipos de iluminacin LED en todas las instituciones pblicas. La medida se implementa a travs de las fichas de homologacin de tecnologa LED, aprobadas por el MINEM, y que son instrumentos que permiten el reemplazo de luminarias menos eficientes por lmparas y otros equipos de iluminacin LED en los procesos de compras pblicas, lo que permite adems la inclusin de estas tecnologas en la implementacin de nuevos establecimientos estatales.'',''1'',''Impulsar el uso de lmparas eficientes en el sector pblico a travs de las Fichas de Homologacin de lmparas de tecnologa LED. Aplica para lmparas LED. ','1','Impulsar el uso de lmparas eficientes en el sector pblico a travs de las Fichas de Homologacin de lmparas de tecnologa LED. Aplica para lmparas LED.Impulsar el uso de lmparas eficientes en el sector pblico a travs de las Fichas de Homologacin de lmparas de tecnologa LED. Aplica para lmparas LED. ','Energa - Combustin estacionaria','1');
